import React from 'react';

import Todo from './Todo';


const Todos = (props) => {
  const handlinger = props.handling.map((handling) => {
    return <Todo key={handling.id} handling={handling} onAcceptClick={props.AddTodo}/>
  });

  return <div className="ui container">{handlinger}</div>
};

export default Todos;
